"url:p3/widget/templates/ItemDetailPanel.html":'\x3cdiv class\x3d"ItemDetailPanel noSelection dataItem"\x3e\n  \x3cdiv class\x3d"noItemSelection"\x3e\n    Nothing selected.\n\n    \x3cdiv class\x3d"folder containerContentSection"\x3e\n        \x3cdiv class\x3d"tip"\x3e\n\n          \x3cdiv class\x3d\'tipHeader\'\x3e\n            \x3cspan class\x3d"fa icon-lightbulb-o fa-2x" style\x3d"color: orange;"\x3e\x3c/span\x3e\n          \x3c/div\x3e\n          \x3cdiv\x3eThe PATRIC workspace is for managing files, groups, and job results.\n            \x3ca class\x3d"HelpLink" href\x3d"https://docs.patricbrc.org/user_guides/workspaces.html" target\x3d"_blank"\x3eLearn more.\x3c/a\x3e\n          \x3c/div\x3e\n        \x3c/div\x3e\n    \x3c/div\x3e\n\n\n    \x3cdiv class\x3d"resultContentSection"\x3e\n      \x3cdiv class\x3d"tip"\x3e\n\n        \x3cdiv class\x3d\'tipHeader\'\x3e\n          \x3cspan class\x3d"fa icon-lightbulb-o fa-2x" style\x3d"color: orange;"\x3e\x3c/span\x3e\n        \x3c/div\x3e\n        \x3cdiv\x3eSelect one or more items on the left to see their details and possible actions.\x3c/div\x3e\n      \x3c/div\x3e\n    \x3c/div\x3e\n\n        \x3cdiv class\x3d"experiment containerContentSection"\x3e\n            \x3cdiv class\x3d"tip"\x3e\n\n                \x3cdiv class\x3d\'tipHeader\'\x3e\n                    \x3cspan class\x3d"fa icon-lightbulb-o fa-2x" style\x3d"color: purple;"\x3e\x3c/span\x3e\n                \x3c/div\x3e\n                \x3cdiv\x3eSignificant by z-score: abs(z-score) \x26gt;\x3d 2. Significant by log ratio: abs(log ratio) \x26gt;\x3d1.\x3c/div\x3e\n            \x3c/div\x3e\n        \x3c/div\x3e\n\n    \x3cdiv class\x3d"folder containerContentSection"\x3e\n      \x3cdiv class\x3d"tip"\x3e\n        \x3cdiv class\x3d\'tipHeader\'\x3e\n          \x3cspan class\x3d"fa icon-lightbulb-o fa-2x" style\x3d"color:orange;"\x3e\x3c/span\x3e\n        \x3c/div\x3e\n          \x3cp\x3eClick an item\'s icon (e.g.,  \x3cspan class\x3d"fa icon-folder fa-1x"\x3e\x3c/span\x3e, \x3cspan class\x3d"fa icon-genome-features fa-1x"\x3e\x3c/span\x3e ) or double click on a row to drill down into that item.\x3c/p\x3e\n\n      \x3c/div\x3e\n    \x3c/div\x3e\n\n  \x3c/div\x3e\n\n  \x3cdiv class\x3d"multipleItemSelection"\x3e\n    \x3cdiv data-dojo-attach-point\x3d"countDisplayNode"\x3eN items selected.\x3c/div\x3e\n  \x3c/div\x3e\n\n  \x3cdiv class\x3d"singleItemSelection"\x3e\n    \x3cdiv class\x3d"workspaceItemSelection"\x3e\n  \x3cdiv\x3e\n    \x3ctable class\x3d"ItemDetailHeaderTable"\x3e\n      \x3ctbody\x3e\n        \x3ctr\x3e\n          \x3ctd style\x3d"width:1%"\x3e\x3ci class\x3d"fa fa-1x" data-dojo-attach-point\x3d"typeIcon" \x3e\x3c/i\x3e\x3c/td\x3e\n          \x3ctd\x3e\n            \x3cdiv class\x3d"ItemDetailHeader" data-dojo-type\x3d"dijit/InlineEditBox" data-dojo-attach-point\x3d"nameWidget" disabled\x3d"true"\x3e\x3c/div\x3e\n          \x3c/td\x3e\n        \x3c/tr\x3e\n      \x3c/tbody\x3e\n    \x3c/table\x3e\n  \x3c/div\x3e\n  \x3cdiv style\x3d"font-size:1em"\x3e\n    \x3cdiv class\x3d"ItemDetailAttribute"\x3e\n      Type: \x3cdiv class\x3d"ItemDetailAttributeValue"\n          data-dojo-attach-event\x3d"onChange:saveType"\n          data-dojo-attach-point\x3d"typeNode"\n          data-dojo-type\x3d"dijit/InlineEditBox"\n          data-dojo-props\x3d"editor:\'dijit.form.Select\', autoSave:false, editorParams:{options:[]}"\n          value\x3d""\n          disabled\x3d"true"\x3e\x3c/div\x3e\n    \x3c/div\x3e\n    \x3cbr\x3e\n    \x3cdiv class\x3d"ItemDetailAttribute"\x3eOwner: \x3cspan class\x3d"ItemDetailAttributeValue"  data-dojo-attach-point\x3d"owner_idNode"\x3e\x3c/span\x3e\x3c/div\x3e\x3cbr\x3e\n    \x3cdiv class\x3d"ItemDetailAttribute"\x3eCreated: \x3cspan class\x3d"ItemDetailAttributeValue" data-dojo-attach-point\x3d"creation_timeNode"\x3e\x3c/span\x3e\x3c/div\x3e\x3cbr\x3e\n    \x3cdiv class\x3d"ItemDetailAttribute"\x3ePath: \x3cspan class\x3d"ItemDetailAttributeValue" data-dojo-attach-point\x3d"pathNode"\x3e\x3c/span\x3e\x3c/div\x3e\n\n    \x3cbr\x3e\x3cbr\x3e\n\n    \x3cdiv class\x3d"ItemDetailAttribute"\x3e\n      \x3cspan data-dojo-attach-point\x3d"permissionsNode"\x3e\x3c/span\x3e\n    \x3c/div\x3e\n\n    \x3cdiv style\x3d"display:none;" data-dojo-attach-point\x3d"idNode"\x3e\x3c/div\x3e\n  \x3c/div\x3e\n  \x3cdiv style\x3d"display:none" class\x3d"specialHelp" data-dojo-attach-point\x3d"featureGroupHelp"\x3e\n      \x3cdiv class\x3d"tip"\x3e\n\n        \x3cdiv class\x3d\'tipHeader\'\x3e\n          \x3cspan class\x3d"fa icon-lightbulb-o fa-2x" style\x3d"color: orange;"\x3e\x3c/span\x3e\n        \x3c/div\x3e\n        \x3cdiv\x3eFeatures of interest can be added to groups in PATRIC. When a new feature group is created it will appear here.\x3c/div\x3e\n      \x3c/div\x3e\n  \x3c/div\x3e\n  \x3cdiv style\x3d"display:none" class\x3d"specialHelp" data-dojo-attach-point\x3d"genomeGroupHelp"\x3e\n      \x3cdiv class\x3d"tip"\x3e\n\n        \x3cdiv class\x3d\'tipHeader\'\x3e\n          \x3cspan class\x3d"fa icon-lightbulb-o fa-2x" style\x3d"color: orange;"\x3e\x3c/span\x3e\n        \x3c/div\x3e\n        \x3cdiv\x3eGenomes of interest can be added to groups in PATRIC. When a new genome group is created it will appear here.\x3c/div\x3e\n      \x3c/div\x3e\n  \x3c/div\x3e\n  \x3cdiv style\x3d"display:none" class\x3d"specialHelp" data-dojo-attach-point\x3d"experimentHelp"\x3e\n      \x3cdiv class\x3d"tip"\x3e\n\n        \x3cdiv class\x3d\'tipHeader\'\x3e\n          \x3cspan class\x3d"fa icon-lightbulb-o fa-2x" style\x3d"color: orange;"\x3e\x3c/span\x3e\n        \x3c/div\x3e\n        \x3cdiv\x3eThe default location for experiments added through the Expression Import service.\x3c/div\x3e\n      \x3c/div\x3e\n  \x3c/div\x3e\n  \x3cdiv style\x3d"display:none" class\x3d"specialHelp" data-dojo-attach-point\x3d"experimentGroupHelp"\x3e\n      \x3cdiv class\x3d"tip"\x3e\n\n        \x3cdiv class\x3d\'tipHeader\'\x3e\n          \x3cspan class\x3d"fa icon-lightbulb-o fa-2x" style\x3d"color: orange;"\x3e\x3c/span\x3e\n        \x3c/div\x3e\n        \x3cdiv\x3eExperiments of interest can be added to groups in PATRIC. When a new experiment group is created it will appear here. PATRIC contains curated datasets representing transcriptomic experiments. Both curated datasets and experiments created by the Expression Import service can be added to a group.\x3c/div\x3e\n      \x3c/div\x3e\n  \x3c/div\x3e\n  \x3cdiv data-dojo-attach-point\x3d"autoMeta"\x3e\n\n  \x3c/div\x3e\n  \x3ctable\x3e\n    \x3ctbody data-dojo-attach-point\x3d"userMetadataTable"\x3e\n    \x3c/tbody\x3e\n  \x3c/table\x3e\n  \x3c/div\x3e\n  \x3cdiv data-dojo-attach-point\x3d"dataItemSelection" class\x3d"dataItemSelection"\x3e\n    \x3cdiv data-dojo-attach-point\x3d"itemBody"\x3e\n\n    \x3c/div\x3e\n  \x3c/div\x3e\n\n  \x3c/div\x3e\n\x3c/div\x3e\n',
